import styles from "./ServiceList.module.css"

function ServiceList(props) {
    return (
        <div className={styles.card}>
            <img src={props.imageUrl} alt="" />
            <h2>{props.name}</h2>
            <h3>{props.price}</h3>
            <h4>Рейтинг: {props.rating}</h4>
        </div>
    )
}

export default ServiceList
